def toDouble(s : String): Double = try{if (s.isEmpty) 0 else s.toDouble} catch {case e :Exception  => 0 }
def toInt(s : String): Int = try{ if (s.isEmpty) 0  else s.toInt } catch {case e :Exception  => 0 }
def toBigInt(s : String): BigInt = try{if (s.isEmpty) BigInt(0) else BigInt(s)} catch {case e :Exception  => 0 }

val DF_mentions = mentionsRDD.map(_.split("\t")).filter(array => (array.length==14 || array.length==15)).map{
    m  =>
        var language = ""
        if(m.length==14){
            language = "GT-ENG"
        }
        else{
            language = m(14)
        }
        Mention(
            toInt(m(0)),m(1),m(2),toInt(m(3)),m(4),m(5),toInt(m(6)),toInt(m(7)),toInt(m(8)),toInt(m(9)),toInt(m(10)),toInt(m(11)),toInt(m(12)),toDouble(m(13)),language,"")

}.toDF.select("GLOBALEVENTID",
"EventTimeDate",
"MentionType",
"Confidence",
"MentionDocTranslationInfo")

val pattern_GT = new Regex("GT-[A-Z]*")

def strConvert[T](v: Option[T]): String = {
    v.map(_.toString).getOrElse("")
}

def cleanLanguage: (String => String) = { s => pattern_GT.findFirstIn(s).getOrElse("").replace("GT-","") } 
val cleanLanguageUDF = udf(cleanLanguage)

val DF_mentionsClean = DF_mentions.withColumn("MentionDocTranslationInfo", cleanLanguageUDF(DF_mentions("MentionDocTranslationInfo"))).distinct()

DF_mentionsClean.createOrReplaceTempView("mention")
 spark.catalog.cacheTable("mention")

