def strConvert[T](v: Option[T]): String = {
    v.map(_.toString).getOrElse("")
}

def findMonth: (String => String) = { s => s.slice(4,6)} 
val findMonthUDF = udf(findMonth)

def findDay: (String => String) = {  s => s.slice(6,8) } 
val findDayUDF = udf(findDay)

val DF_exportClean = DF_export.withColumn("Month", findMonthUDF(DF_export("SQLDATE"))).withColumn("Day", findDayUDF(DF_export("SQLDATE")))

DF_exportClean.createOrReplaceTempView("export")
 spark.catalog.cacheTable("export")
